     from UNICAEN_UTILISATEUR_USER utilisateur,
          unicaen_utilisateur_role role
     where utilisateur.username in ('valleet01-demo', 'dupre-demo', 'gautrea221-demo', 'lobstein-demo', 'burel222-demo', 'houillier-demo')
     and role.role_id not in ('Stagiaire')
)
on conflict do nothing;

